INSERT INTO `plugins` VALUES (1,NULL,'Plugin Whatsapp Wordpress Woocoomerce Gratis','plugin-whatsapp-wordpress-woocoomerce-gratis','Plugin Woocommerce whatsapp Wordpress gratis','Plugin whatsapp Wordpress para envio de notificaciones automatizadas desde Woocommerce','plugin whatsapp, plugin whatsapp wordpress, plugin whatsapp woocommerce, notificaciones woocommerce','Plugin para enviar notificaciones automáticas desde Woocommerce gratis','<h2>Plugin Whatsapp Wordpress Woocoomerce</h2><p>Plugin whatsapp wordpress gratuito para que enviés notificaciones a tus clientes de una manera profesional. Tus clientes agradecerán que les notifiques en cada estado de pedido.&nbsp;</p><p>Con este plugin Whatsapp Wordpress de smsenlienea, podrás configurar un mensaje personalizado para cada estado de pedido que tengas configurado en tu sitio, de manera que cuando el pedido ingresa a tu tienda, el cliente recibirá una notificación via whatsapp o via mesaje de texto segun como configures tu API en de smsenlinea.<br><br><br></p><h3><font color=\"#397b21\"><b style=\"\">Carácterísticas</b>:&nbsp;</font></h3><ul><li><font color=\"#397b21\"><b>Conecta tu Whatsapp Businnes a Woocommerce para enviar notificaciones</b></font></li></ul><blockquote><p>•<span style=\"white-space:pre\">	</span>Envío notificación Woocommerce para clientes<br>•<span style=\"white-space:pre\">	</span>Envío notificaciones a administradores<br>•<span style=\"white-space:pre\">	</span>Envío notificaciones vía Whatsapp o SMS&nbsp;<br>•<span style=\"white-space:pre\">	</span>Personalización de mensajes con múltiples variables<br>•<span style=\"white-space:pre\">	</span>Envía a sus clientes enlaces para dejar reseñas en sus productos.<br>•<span style=\"white-space:pre\">	</span>Integración con los formularios de contacto de Gravity Form<br>•<span style=\"white-space:pre\">	</span>envío de lista de compras<br>•<span style=\"white-space:pre\">	</span>Envío de cantidad de productos adquiridos en la compra<br>•<span style=\"white-space:pre\">	</span>Inserción de enlace de descarga de factura en el mensaje Whatsapp o SMS</p></blockquote><p><font color=\"#397b21\">y más opciones de notificación.</font></p><h3></h3><h3><b>Requisitos</b>:&nbsp;</h3><ol><li>Debes estar degistrado(a) o <a href=\"https://whatsapp.smsenlinea.com/dashboard/auth/register\" target=\"_blank\">registrarte en SmsEnLinea</a>&nbsp;(<b>Registrate gratis y usa el plugin tambien</b>)</li><li>Sitio de WordPress actualizado</li><li>Tener instalado Woocommerce o Gravity Form</li><li><b>Puedes usar el plugin en la version gratuita de SMSenlinea</b> (Marca de agua en los mensajes enviados)</li></ol><p><b>PERSONALIZACIÓN DE NOTIFICACIONES</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"Captura de pantalla 2025-06-23 115256.png\" style=\"width: 744.031px;\"></p><p><b>INSERCIÓN DE EMOJIS EN MENSAJES DE NOTIFICACIÓN</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"Captura de pantalla 2025-06-23 115317.png\" style=\"width: 50%;\"></p>','assets/images/plugins/featured-68598bb644e892.03197920-PLUGIN WORDPRESS WHATSAPP WOOCOMMERCE.webp','https://www.youtube.com/watch?v=23HccQmAZj0&list=PLkDRfxPVHKGmafPUxd3TKxxowqQjHqBFY&index=3','[\"assets\\/images\\/plugins\\/gallery-68598bb644e396.76782636-PLUGIN WORDPRESS WHATSAPP WOOCOMMERCE - CODIGOS CORTOS.webp\",\"assets\\/images\\/plugins\\/gallery-68598bb644e641.35665250-PLUGIN WORDPRESS WHATSAPP WOOCOMMERCE - CONFIGURACION.webp\",\"assets\\/images\\/plugins\\/gallery-68598bb644e6c3.24545423-PLUGIN WORDPRESS WHATSAPP WOOCOMMERCE - EMOJIS.webp\",\"assets\\/images\\/plugins\\/gallery-68598bb644e746.54530156-PLUGIN WORDPRESS WHATSAPP WOOCOMMERCE - HISTORIAL.webp\",\"assets\\/images\\/plugins\\/gallery-68598bb644e7a6.06496039-PLUGIN WORDPRESS WHATSAPP WOOCOMMERCE - NOTIFICACION A ADMIN.webp\"]','plugin-68c5e75bb1ada3.23353915-wc-smsenlinea-notifier-1.5.0.zip','14806','1.5.0',0.00,327,'active',0,'2025-06-22 21:46:36','2025-10-06 23:48:51'),(2,NULL,'Plugin Whatsapp Boto